var title_f40_63_41977="Digestive organ development";
var content_f40_63_41977=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F66413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F66413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 576px\">",
"   <div class=\"ttl\">",
"    Development of the digestive organs",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 556px; height: 757px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Origin of the accessory organs of digestion.",
"    <br>",
"     (A-B) The accessory organs of digestion (liver, gallbladder, and pancreas) first emerge as buds of the foregut tube in the space provided by the ventral mesentery.",
"     <br>",
"      (C-E) As the organs enlarge and move, the foregut mesentery goes with them and persists in the same way that the dorsal mesentery does.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Reproduced with permission from: Sadler TW. Langman's Medical Embryology, 10th Edition. Baltimore: Lippincott Williams &amp; Wilkins, 2006. Copyright &copy; 2006 Lippincott Williams &amp; Wilkins.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
