var title_f40_63_41978="Cylindrical bronchiectasis";
var content_f40_63_41978=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F54378%7EPULM%2F70276%7EPULM%2F78762%7EPULM%2F53471%7EPULM%2F69987%7EPULM%2F70396%7EPULM%2F64077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F54378%7EPULM%2F70276%7EPULM%2F78762%7EPULM%2F53471%7EPULM%2F69987%7EPULM%2F70396%7EPULM%2F64077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cylindrical bronchiectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 356px; height: 306px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    HRCT shows scarring with bibasilar loss of volume in the posterobasal and laterobasal segments of both lower lobes. The segmental bronchi are mildly distended and distorted (arrows). They are wider in diameter than their accompanying segmental pulmonary artery branches and are close together. These changes are probably due to a previous, incompletely resolved pneumonia.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cylindrical bronchiectasis of right lower lobe",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 355px; height: 308px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    HRCT shows mild dilatation of the posterobasal and laterobasal segmental bronchi in the right lower lobe (long arrow). Multiple ill-defined, peripheral right lower lobe nodules are visible and represent mucous plugs in dilated subsegmental bronchi (short arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Cylindrical bronchiectasis in the right middle lobe",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 338px; height: 283px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Multiple circular lucencies (arrow) are seen in the contracted middle lobe, most likely as part of a so-called right middle lobe syndrome.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    CT scan of the lungs in a patient with cystic fibrosis, demonstrating bronchiectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 347px; height: 292px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Computerized tomography (CT)&nbsp;of the chest in a patient with cystic fibrosis demonstrates mild cylindrical bronchiectasis, with thickened bronchial walls involving the upper lobes and the superior segments of the lower lobes. Note the subsegmental atelectasis in the posterior segment of the right upper lobe.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Severe bronchiectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 360px; height: 332px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Severe bronchiectasis in a destroyed right lung as a sequel of necrotizing pneumonia. There is complete cicatrization atelectasis of the right lung with a cardiomediastinal shift to the right. The right lung is permeated by small cystic structures consistent with cystic bronchiectasis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Postradiation traction bronchiectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 373px; height: 298px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Traction bronchiectasis in a patient with Hodgkin's disease and previous mantle irradiation. The main finding is paramediastinal radiation fibrosis, with loss of volume and mild cylindrical bronchiectasis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Central bronchiectasis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 349px; height: 301px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Central bronchiectasis in a patient with allergic bronchopulmonary aspergillosis. Multiple dilated third and fourth generation bronchi are seen. Smaller peripheral bronchi filled with mucus account for the branching linear opacities in the distal lung parenchyma.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
